{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/kartik1trivedi/amazon-top-100-trending-books-eda?scriptVersionId=171155116\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"6cd1f146","metadata":{"papermill":{"duration":0.015139,"end_time":"2024-04-09T12:11:54.413436","exception":false,"start_time":"2024-04-09T12:11:54.398297","status":"completed"},"tags":[]},"source":["# Objective of Analysis\n","The primary objective of this analysis is to perform a comprehensive exploratory data analysis which could help us better understand the datasets, provide insights on readers preferences and reading trends. By leveraging statistical and visual exploration techniques, we aim to uncover meaningful information that can aid informed stratergic decision in the realm of literature, publishing and reader engagement."]},{"cell_type":"markdown","id":"1de9de44","metadata":{"papermill":{"duration":0.01573,"end_time":"2024-04-09T12:11:54.44327","exception":false,"start_time":"2024-04-09T12:11:54.42754","status":"completed"},"tags":[]},"source":["# Goals of Analysis\n","#### 1. Understand Reader Preferences\n","Explore and analyze details of the top 100 trending books, including book titles, prices, publication years, and author information. Identify patterns and trends to gain a comprehensive understanding of reader preferences and the factors contributing to a book's popularity.\n","\n","#### 2. Uncover Reasons for Book Preference\n","Conduct sentiment analysis on review titles and review descriptions associated with each book in the dataset. Delve into customer sentiments to discern the underlying reasons why readers favor specific books, examining the emotional and qualitative aspects that influence their choices.\n","\n","#### 3. Provide Actionable Insights\n","Synthesize findings into actionable insights that can inform product development, publication strategies, and reader engagement initiatives. Propose recommendations based on the analysis to enhance the understanding of market demands, optimize future book releases, and foster stronger connections with readers for improved satisfaction and loyalty."]},{"cell_type":"markdown","id":"dea31686","metadata":{"papermill":{"duration":0.014984,"end_time":"2024-04-09T12:11:54.472391","exception":false,"start_time":"2024-04-09T12:11:54.457407","status":"completed"},"tags":[]},"source":["# Dataset Used\n","/kaggle/input/top-200-trending-books-with-reviews\n","\n","## Files Used\n","* /kaggle/input/top-200-trending-books-with-reviews/Top-100 Trending Books.csv\n","* /kaggle/input/top-200-trending-books-with-reviews/customer reviews.csv"]},{"cell_type":"code","execution_count":1,"id":"7e7cfd7c","metadata":{"execution":{"iopub.execute_input":"2024-04-09T12:11:54.50979Z","iopub.status.busy":"2024-04-09T12:11:54.507035Z","iopub.status.idle":"2024-04-09T12:11:57.759135Z","shell.execute_reply":"2024-04-09T12:11:57.756666Z"},"papermill":{"duration":3.274322,"end_time":"2024-04-09T12:11:57.762544","exception":false,"start_time":"2024-04-09T12:11:54.488222","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.3     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.4     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.3     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.2     \n","── \u001b[1mConflicts\u001b[22m ──