hiDYAQAAZIj/BzaKtcFs\njmWfAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Average rating and reviewer rating by year of publication\n","joined_data %>%\n","group_by(year.of.publication) %>%\n","summarize(average.rating = mean(rating),\n","          average.reviewer.rating = mean(reviewer.rating)) %>%\n","ggplot(aes(x = year.of.publication)) +\n","  geom_line(aes(y = average.rating, color = \"Average Rating\"), size = 0.75 ) +\n","  geom_line(aes(y = average.reviewer.rating, color = \"Average Reviewer Rating\"), size = 0.75) +\n","  labs(title = \"Average Rating and Average Reviewer Rating Over Years\",\n","       x = \"Year of Publication\",\n","       y = \"Rating\") +\n","  scale_color_manual(values = c(\"Average Rating\" = \"blue\", \"Average Reviewer Rating\" = \"red\")) +\n","  theme_minimal()"]},{"cell_type":"markdown","id":"457beeec","metadata":{"papermill":{"duration":0.037843,"end_time":"2024-04-09T12:12:08.167305","exception":false,"start_time":"2024-04-09T12:12:08.129462","status":"completed"},"tags":[]},"source":["#### Analysis\n","* Out of the 92 books with available customer reviews, the average ratings given by reviewers in the customer_review dataset are higher than the corresponding actual ratings of the books listed on Amazon's website for 70 of these books.\n","* Additionally, this difference is prominent even for books with year of publication after 2020, which has most number of books in top 100 trending books.  "]},{"cell_type":"markdown","id":"a3cd91bc","metadata":{"papermill":{"duration":0.037926,"end_time":"2024-04-09T12:12:08.245815","exception":false,"start_time":"2024-04-09T12:12:08.207889","status":"completed"},"tags":[]},"source":["For most books ratings provided by reviewers are higher than corresponding actual ratings and reviews contributing to the observed trend contains relatively old reviews, spanning a timeframe of 12 to 13 years. This discovery raises concerns about the credibility of the dataset, as it appears to include reviews from an extended period. Due to the ambiguity surrounding the data collection process for customer reviews, we will extract the most frequently used words from both review titles and descriptions. However, these extracted words will not be integrated into our final analysis outcomes."]},{"cell_type":"markdown","id":"e07d55a7","metadata":{"papermill":{"duration":0.038041,"end_time":"2024-04-09T12:12:08.321343","exception":false,"start_time":"2024-04-09T12:12:08.283302","status":"completed"},"tags":[]},"source":["## Finding trending keywords in review title and review description"]},{"cell_type":"code","execution_count":40,"id":"db1dd619","metadata":{"execution":{"iopub.execute_input":"2024-04-09T12:12:08.40366Z","iopub.status.busy":"2024-04-09T12:12:08.401246Z","iopub.status.idle":"2024-04-09T12:12:08.453749Z","shell.execute_reply":"2024-04-09T12:12:08.450848Z"},"papermill":{"duration":0.097579,"end_time":"2024-04-09T12:12:08.45742","exception":false,"start_time":"2024-04-09T12:12:08.359841","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["'data.frame':\t1149 obs. of  2 variables:\n"," $ keyword.word   : chr  \"a\" \"a's\" \"able\" \"about\" ...\n"," $ keyword.lexicon: chr  \"SMART\" \"SMART\" \"SMART\" \"SMART\" ...\n"]}],"source":["# creating a new data frame tokenising and pre processing review.title\n","review_title <- customer_review_v1 %>%\n","  unnest_tokens(keyword, review.title, token = \"words\")\n","\n","# Load the stop words data\n","stop_words <- data.frame(keyword = stop_words)\n","str(stop_words)"]},{"cell_type":"code","execution_count":41,"id":"62367460","metadata":{"execution":{"iopub.execute_input":"2024-04-09T12:12:08.538176Z","iopub.status.busy":"2024-04-09T12:12:08.535988Z","iopub.status.idle":"2024-04-09T12:12:08.565198Z","shell.execute_reply":"2024-04-09T12:12:08.562525Z"},"papermill":{"duration":0.074198,"end_time":"2024-04-09T12:12