CQIOwAAAEkQ\ndgAAAJIg7AAAACRB2AEAAEiCsAMAAJAEYQcAACAJwg4AAEAS/wJ/tNmEHCXoFwAAAABJRU5E\nrkJggg=="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["print(\"200 most used keywords in review description\")\n","# removing stop words from review_title column\n","review.description.keywords <- anti_join(review_description, stop_words, by = \"keyword\")\n","\n","# Create a word cloud\n","review.description.keyword <- review.description.keywords %>%\n","  group_by(keyword) %>%\n","  summarise(n = n()) %>%\n","  arrange(desc(n)) %>%\n","  slice_head(n = 200)\n","\n","wordcloud(words = review.description.keyword$keyword, freq = review.description.keyword$n, scale = c(8, 0.75), colors = brewer.pal(8, \"Dark2\"))"]},{"cell_type":"markdown","id":"de7a8189","metadata":{"papermill":{"duration":0.049716,"end_time":"2024-04-09T12:12:12.231056","exception":false,"start_time":"2024-04-09T12:12:12.18134","status":"completed"},"tags":[]},"source":["# Key Takeaways\n","* There is a notable demand for children's books, making it the second most prominent genre. However, it's noteworthy that in many instances, the buyers of children's books are not the actual readers. They seek affordability, as evidenced by the fact that the five least expensive books among the top 100 trending books fall under the children's genre. Moreover, the average price for children's books is 8.7 dollars, significantly lower than the overall average book price of 12.81 dollars. This underscores the clear preference for purchasing children's books that are budget-friendly.\n","\n","* There is a robust demand for fantasy books, the fantasy genre ranks as the fourth most popular among the top 100 trending books. Remarkably, enthusiasts exhibit a willingness to invest in these books at premium prices, with the fantasy genre boasting the highest average price of 19 dollars. This figure is approximately 1.5 times higher than the overall average book price of 12.81 dollars and significantly surpasses the second most expensive genre, self-help, which is priced at 15.9 dollars.\n","\n","* The analysis reveals a notable pattern where reviewer ratings tend to be higher than the actual ratings of the books, indicating a potential bias in the reviews. Moreover, the dataset incorporates reviews spanning a considerable 12 to 13-year timeframe, casting doubt on its reliability. Given the uncertainty surrounding the data collection process for customer reviews, conducting an unbiased sentiment analysis becomes highly challenging. "]},{"cell_type":"markdown","id":"b346054b","metadata":{"papermill":{"duration":0.044905,"end_time":"2024-04-09T12:12:12.321605","exception":false,"start_time":"2024-04-09T12:12:12.2767","status":"completed"},"tags":[]},"source":["# Key Recommendations\n","#### Implement transparent practices\n","Improve transparency in the data collection process by providing detailed information on the timeframe covered and criteria for review inclusion. This will enhance confidence in the dataset's reliability and accuracy.\n","\n","#### Consider user intent in book pricing\n","Recognize the unique dynamics in book market where buyers may not be end users like in children books or enthusiasts willingness to pay premium prices like in case of fantasy books. Crafting a strategic pricing model could prove advantageous, as it would be adept at capturing consumer preferences and meeting diverse customer needs, thereby optimizing revenue without compromising customer satisfaction.\n"]},{"cell_type":"markdown","id":"8f47e655","metadata":{"papermill":{"duration":0.044323,"end_time":"2024-04-09T12:12:12.410312","exception":false,"start_time":"2024-04-09T12:12:12.365989","status":"completed"},"tags":[]},"source":["# Scope of Further Study\n","It is strongly advisable to gather customer reviews for sentiment analysis. However, this time, instead of limiting the number of reviews, consider collecting all available reviews on the Amazon website for these books or capturing reviews over a specific timeframe. This approach minimizes the likelihood of bias."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3968810,"sourceId":6926747,"sourceType":"datasetVersion"}],"dockerImageVersionId":30582,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":21.958723,"end_time":"2024-04-09T12:12:12.580594","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-04-09T12:11:50.621871","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}